import React, { useState } from 'react';

const BookNow = () => {
    const [Bookings, setBookings] = useState({
        id: "",  // Add id field
        name: "",
        email: "",
        destination: "",
        date: ""
    });

    const addBookings = async (e) => {
        e.preventDefault();
        try {
            const response = await fetch("http://localhost:3001/bookings", {
                method: "POST",
                body: JSON.stringify(Bookings),
                headers: {
                    "Content-Type": "application/json"
                }
            });

            if (response.ok) {
                const result = await response.json();
                alert("Booking added successfully!");
                console.log(result);
            } else {
                console.error("Error:", response.statusText);
            }
        } catch (err) {
            console.error("Error adding booking:", err);
        }
    };

    const handleChange = (e) => {
        setBookings({
            ...Bookings,
            [e.target.name]: e.target.value
        });
    };

    return (
        <>
            <div className="bg-image" 
                style={{ 
                    backgroundImage: "url('https://img.freepik.com/premium-photo/soft-blur-nature-background-abstract-modern-website-graphics-with-smooth-gradient-background_532332-40.jpg')", 
                    backgroundRepeat: "no-repeat",
                    backgroundSize: "100% 100%",
                    height: "100vh"
                }}>
                <div className="container">
                    <h1 className="text-center text-light-emphasis"><b>Book Your Destination</b></h1>
                    <form className="mt-4" onSubmit={addBookings}>
                        {/* Booking ID input */}
                        <div className="mb-3">
                            <label className="form-label">Booking ID</label>
                            <input
                                type="number"
                                className="form-control"
                                name="id"
                                placeholder='Enter Booking ID'
                                value={Bookings.id}
                                onChange={handleChange}
                                required
                            />
                        </div>
                        <div className="mb-3">
                            <label className="form-label">Full Name</label>
                            <input
                                type="text"
                                className="form-control"
                                name="name"
                                placeholder='Please Enter Your Full Name'
                                value={Bookings.name}
                                onChange={handleChange}
                                required
                            />
                        </div>
                        <div className="mb-3">
                            <label className="form-label">Email</label>
                            <input
                                type="email"
                                className="form-control"
                                name="email"
                                placeholder='Please Enter Your E-mail'
                                value={Bookings.email}
                                onChange={handleChange}
                                required
                            />
                        </div>
                        <div className="mb-3">
                            <label className="form-label">Destination</label>
                            <input
                                type="text"
                                className="form-control"
                                name="destination"
                                placeholder='Please Enter Your Dream Place'
                                value={Bookings.destination}
                                onChange={handleChange}
                                required
                            />
                        </div>
                        <div className="mb-3">
                            <label className="form-label">Travel Date</label>
                            <input
                                type="date"
                                className="form-control"
                                name="date"
                                value={Bookings.date}
                                onChange={handleChange}
                                required
                            />
                        </div><br/>
                        <button type="submit" className="btn btn-outline-secondary text-light">Submit</button>
                    </form>
                </div>
            </div>
        </>
    );
}

export default BookNow;






















